import { useState } from 'react';
import Layout from '../../components/Layout'
import * as Co from '../../css/comerciocss'
 
const Comercio = () => {
 
    return ( 
        <motion.div>
            <Layout>
                <Co.ComercioWrapper>
                    <h5> dani</h5>
                </Co.ComercioWrapper>
            </Layout>
        </motion.div>
     );
}
 
export default Comercio;
